import Link from 'next/link';

export default () =>
    <div>
        <style jsx>{`
        h1 {
            font-size: 68pt;
            font-weight: bold;
            text-align: center;
            color: #f0f0f0;
        }
        p  {
            margin: 0px;
            color: #666;
            font-size: 16pt;
        }
        `}</style>
        <h1>Next.js</h1>
        <p>welcome to next.js!</p>
        <Link href="/other">
            <a>go to other page &gt;&gt;</a>
        </Link>
    </div>
